import { useEffect } from "react";

function App() {
  useEffect(() => {
    fetch("http://127.0.0.1:5555/dates")
      .then((r) => r.json())
      .then((dates) => console.log(dates));
  }, []);

  return <h1>Check the console for a list of dates!</h1>;
}

export default App;

